import { Navigate, PartialRouteObject } from "react-router-dom"

import PermissionTypeCreatePage from "./PermissionTypeCreatePage"
import PermissionTypePage from "./PermissionTypesPage"
import PermissionTypeUpdatePage from "./PermissionTypeUpdatePage"

export const PermissionTypesRoutes: PartialRouteObject[] = [
	{ path: "", element: <Navigate to="/permission/list" /> },
	{ path: "list", element: <PermissionTypePage /> },
	{ path: "create", element: <PermissionTypeCreatePage /> },
	{ path: "update/:id", element: <PermissionTypeUpdatePage /> },
	{
		path: "types",
		element: <Navigate to="/permission/types/list" />,
		children: [
			{
				path: "/list",
				element: <PermissionTypePage />,
			},
		],
	},
]
